INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES ("きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, 113401, 0.0, 211, 2, 24019, 10046, 0.0, "ハツネ", 1, 4.52);
